            for (index, tokens) in batch.enumerated() {
                print("Processing tokenized prompt \(batchIndex + index): \(tokens)")
                
                // Ensure tokens are correctly passed to the model
                let inputIDs = try MLMultiArray(shape: [1, 77], dataType: .float32)
